import React from 'react';
import styled from 'styled-components';
import ColorBends from '../components/ColorBends';

const PageWrapper = styled.div`
  position: relative;
  min-height: 100vh;
  width: 100%;
`;

const Container = styled.div`
  position: relative;
  padding: 20px;
  max-width: 1200px;
  margin: 0 auto;
  z-index: 1;
`;

function HomePage() {
  return (
    <PageWrapper>
      <ColorBends />
      <Container>
        {/* Здесь будет содержание главной страницы */}
      </Container>
    </PageWrapper>
  );
}

export default HomePage;
